import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Header.css';

function Header() {
  return (
    <header>
      <h1>Наша Кофейня</h1>
      <nav>
        <ul>
          <li><Link to="/">Главная</Link></li>
          <li><Link to="/drinks">Напитки</Link></li>
          <li><Link to="/dishes">Блюда</Link></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
